import Link from 'next/link';

const linkStyle = {
  fontSize: 20,
  marginRight: 15,
  color: '#fff',
  textDecoration: 'none'
};

const headerStyle = {
  height: 100,
  paddingTop: 20,
  paddingLeft: 20,
  backgroundColor: '#090a0b'
}

const Header = () => (
  <div style={headerStyle}>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
